import Layout from '../components/layout'
import {Radio,Table} from 'antd'
import {checkProjects,historys} from '../utils/config'
import moment from "moment"
import Axios from 'axios';
export default class extends React.Component {
  static async getInitialProps({ req,query,jsonPageRes }) {
    const userAgent = req ? req.headers['user-agent'] : navigator.userAgent
    return { userAgent,query,jsonPageRes }
  }
  state = {
    data:{
      list:[]
    },
    searchs:{
      name:"",
      sex:0,
      page:1,
      time_bucket:0,
      check_method:0,
      phone:"",
      appointment_date:""
    }
  }

  async loadList(serachParam){
    let res = await Axios.get(`http://localhost:29001/jg/appointment/list`)
    console.log(res);
    this.setState({data:res.data})
  }

  async componentDidMount(){
     await this.loadList();
  }





  render() {
    let {data} = this.state;
    const columns = [
      {
        title: '姓名',
        dataIndex: 'name',
        key: 'name',
      },
      {
        title: '性别',
        dataIndex: 'sex',
        key: 'sex',
        render:(a,b,c)=>{
          return <span>{b.sex == 1 ? "男":"女"}</span>
        }
      },
      {
        title: '年龄',
        dataIndex: 'age',
        key: 'age',
        render:(a,b,c)=>{
          return <span>{b.age}岁</span>
        }
      },
      {
        title: '手机号',
        dataIndex: 'phone',
        key: 'phone',
      },
      {
        title: '预约时间',
        dataIndex: 'appointment_date',
        key: 'appointment_date',
        render:(a,b,c)=>{
           return <span>{b.appointment_date} {b.time_bucket == 1 ? "上午":"下午"}</span>
        }
      },
      {
        title: '检查项目',
        dataIndex: 'check_project',
        key: 'check_project',
        render:(a,b,c)=>{
           return <span>{checkProjects.find((v)=>{return v.value == b.check_project}).label}</span>
        }
      },
      {
        title: '检查方式',
        dataIndex: 'check_method',
        key: 'check_method',
        render:(a,b,c)=>{
           return <span>{b.check_method == 1 ? "普通":"无痛"}</span>
        }
      },
      {
        title: '既往史',
        dataIndex: 'history',
        key: 'history',
        render:(a,b,c)=>{
           return <span>{historys.find((v)=>{return v.value == b.history}).label}</span>
        }
      },
      {
        title: '过敏史',
        dataIndex: 'allergy_history',
        key: 'allergy_history'
      },
      {
        title: '备注',
        dataIndex: 'remark',
        key: 'remark'
      },
      {
        title: '创建时间',
        dataIndex: 'create_time',
        key: 'create_time',
        render:(a,b,c)=>{
           return <span>{moment(b.create_time).format("YYYY-MM-DD HH:mm:ss")}</span>
        }
      }


    ];
    return (
      <Table rowKey={`id`} pagination={{
        pageSize:data.size,
        total:data.total,
        current:data.page,
        onChange:(page)=>{

        }
    }} dataSource={data.list} columns={columns} />
    )
  }
}
